import React from 'react'
import AccountCircleIcon from '@mui/icons-material/AccountCircle';
import PersonAddIcon from '@mui/icons-material/PersonAdd';
import GroupAddIcon from '@mui/icons-material/PersonAdd';
import AddCircleIcon from '@mui/icons-material/PersonAdd';
import NightlightIcon from '@mui/icons-material/PersonAdd';
import { IconButton } from '@mui/material';

import "./style.css";

function Sidebar() {
  return (
    <div className='sidebar-container'>
        <div className='sidebar-header'>
            <IconButton >
                <AccountCircleIcon />
            </IconButton>
            <IconButton >
                <PersonAddIcon />
            </IconButton>
            <IconButton>
                <GroupAddIcon />
            </IconButton>
            <IconButton>
                <AddCircleIcon />
            </IconButton>
            <IconButton>
                <NightlightIcon />
            </IconButton>

        </div>
        <div className='sidebar-search'>Search</div>
        <div className='sidebar-conversations'>Conversations</div>
    </div>
  )
}

export default Sidebar
